package circle

import (
	"testing"

	"github.com/sushidesu/mewmew/lib/util"
)

func TestIsCircle_False_01(t *testing.T) {
	// X 小さいぐるぐる
	str := ""
	circle, _ := util.ConvertBase64ToImage(str)
	result, _ := IsCircle(circle, t.Logf)

	if result == true {
		t.Fatal("小さいぐるぐる is passed")
	}
}

func TestIsCircle_True_02(t *testing.T) {
	// O 大きめのぐるぐる
	str := ""
	circle, _ := util.ConvertBase64ToImage(str)
	result, err := IsCircle(circle, t.Logf)

	if result == false {
		t.Fatal(err)
	}
}

